ngth - 1][\"value\"] = \"\'\" + row[i] + \"\'\";\n      }\n      else if (valueMeta.getType() == valueMeta.TYPE_DATE && row[i] != null) {\n        var dt = row[i];\n        var dtStr = \"\";\n        dtStr += dt.getDate() + \"-\" + (dt.getMonth()+1) + \"-\" + (1900+dt.getYear());\n        dtStr += \"_\";\n        dtStr += dt.getHours() + \":\" + dt.getMinutes() + \":\" + dt.getSeconds();\n        fields[fields.length - 1][\"value\"] = \"STR_TO_DATE(\'\" + dtStr + \"\', \'%d-%m-%Y_%H:%i:%s\')\";\n      }\n    }\n  }\n\n  return fields;\n}\n\nfunction createQuery(fields) {\n\n  var query = \"\";\n\n  query += \"INSERT INTO \" + getVariable(\"target_table\",\"\") + \" (\";\n\n  for (var i=0; i < fields.length; ) {\n    query += fields[i][\"key\"];\n    if (++i < fields.length) {\n      query += \", \";\n    }\n  }\n\n  query += \") VALUES (\";\n\n  for (var i=0; i < fields.length; ) {\n    query += fields[i][\"value\"];\n    if (++i < fields.length) {\n      query += \", \";\n    }\n  }\n\n  query += \");\";\n\n  return query;\n}'),(1669,17,86,0,'jsScript_type',0,NULL),(1670,17,86,0,'field_name',0,'query'),(1671,17,86,0,'field_rename',0,'query'),(1672,17,86,0,'field_type',0,'String'),(1673,17,86,0,'field_length',-1,NULL),(1674,17,86,0,'field_precision',-1,NULL),(1675,17,86,0,'field_replace',0,'N'),(1676,17,86,0,'cluster_schema',0,NULL),(1677,17,86,0,'row_distribution_code',0,NULL),(1950,19,99,0,'PARTITIONING_SCHEMA',0,NULL),(1951,19,99,0,'PARTITIONING_METHOD',0,'none'),(1952,19,99,0,'compatible',0,'N'),(1953,19,99,0,'optimizationLevel',0,'9'),(1954,19,99,0,'jsScript_name',0,'Script 1'),(1955,19,99,0,'jsScript_script',0,'//Script here\n\nmodified_documents_name = getVariable(\"modified_documents_name\",null).replace(/\\\'/g, \'\\\\\\\'\');\nmodified_folders_name = getVariable(\"modified_folders_name\",null).replace(/\\\'/g, \'\\\\\\\'\');\nunmodified_documents_name = getVariable(\"unmodified_documents_name\",null).replace(/\\\'/g, \'\\\\\\\'\');\nunmodified_folders_name