alfresco_id smallint not null, \";\n  query += \"cmis_basetypeid varchar(512) not null, \";\n  query += \"cmis_objectid varchar(255) not null, \";\n  query += \"cmis_name varchar(512) not null, \";\n  query += \"cmis_creationdate datetime not null, \";\n  query += \"cmis_lastmodificationdate datetime not null, \";\n  query += \"cmis_contentstreamlength int not null, \";\n\n  // Fields.\n  for (var i=0; i < getInputRowMeta().size(); ++i) {\n\n    var valueMeta = getInputRowMeta().getValueMeta(i);\n    var valueMetaName = valueMeta.getName();\n    var valueMetaName = valueMetaName.replace(\"a.\",\"\");\n    var valueMetaName = valueMetaName.replace(\"t.\",\"\");\n\n    if (!valueMetaName.startsWith(\"alfcmis:\") && !valueMetaName.startsWith(\"cmis:\")) {\n\n      query += valueMetaName.replace(\":\", \"_\") + \" \";\n\n      if (valueMeta.getType() == valueMeta.TYPE_BIGNUMBER) {\n        query += \"int \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_BOOLEAN) {\n        query += \"char(1) \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_DATE) {\n        query += \"datetime \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_INTEGER) {\n        query += \"int \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_NUMBER) {\n        query += \"int \";\n      } else {\n        query += \"varchar(512) \";\n      }\n      query += \", \";\n    }\n  }\n\n  // Foreign key.\n  query += \"PRIMARY KEY (id), \";\n\n  // Foreign key.\n  query += \"CONSTRAINT FOREIGN KEY (alfresco_id) REFERENCES dm_dim_alfresco(id) ON DELETE CASCADE \";\n\n  // Ending of the queries.\n  query += \");\";\n\n  return query;\n}\n\nfunction getCreateSqlForStaging(tableName) {\n\n  // Drop table command.\n  var query = \"\";\n  if (getVariable(\"is_force_creation\",\"\").equals(\'true\')) {\n    query += \"DROP TABLE IF EXISTS \" + tableName + \"; \";\n  }\n\n  // Create table definition.\n  query += \"CREATE TABLE \";\n  if (!getVariable(\"is_force_creation\",\"\").e